import Link from "next/link";
import { RiSearchLine } from "react-icons/ri";

const Navbar = () => {
  return (
    <header className="text-[#000000] body-font bg-white shadow-sm">
      <div className="container mx-auto flex flex-wrap items-center justify-between p-5">

    {/* Logo */}
        <Link href="/" className="text-4xl ml-20 font-bold text-black">  Hekto  </Link>

    {/* Navigation Links */}
      <nav className="hidden md:flex flex-wrap items-center text-gray-500 text-[18px] space-x-6 font-semibold">

          <Link href="/" className="hover:text-[#FB2E86]"> Home  </Link>
          <Link href="/pages" className="hover:text-[#FB2E86]"> Pages  </Link>
          <Link href="/products" className= "hover:text-[#FB2E86]">  Products  </Link>
          <Link href="/blog" className="hover:text-[#FB2E86]">  Blog </Link>
          <Link href="/shop" className="hover:text-[#FB2E86]">  Shop  </Link>
          <Link href="/contact" className="hover:text-[#FB2E86]">  Contact  </Link>
      </nav>

  {/* Search and Icons */ }
      <div className="flex items-center space-x-4">
        <div className="relative">
    {/* Input Field */}
      <input
        type="text"
        className="w-[300px] px-4 py-2 rounded-md border hover:border-gray-200 border-gray-300 focus:outline-none focus:ring-2"
      />
    {/* Search Icon */}
        <div className="absolute right-3 top-1/2 mr-[-12px] transform -translate-y-1/2 bg-[#FB2E86] p-2">
        <RiSearchLine className="text-white text-2xl" />
       </div>
      </div>
     </div>
    </div>
  </header>
  );
};

export default Navbar;
